import React from "react";
import PropTypes from "prop-types";

const Title = props => {
  return (
    <React.Fragment>
      <label className="component-label">{props.titleText}</label>
    </React.Fragment>
  );
};

const Featured = props => {
  return <div className="featured">ffs</div>;
};

class Home extends React.Component {
  render() {
    return (
      <div className="home">
        <Featured />
      </div>
    );
  }
}

export default Home;
